measurements.description:
Seventeen flowers on two inflorescences;
	sepals and petals light green boldly striped mahogany, dorsal sepal hooded, petals and lateral sepals falcate;
	lip white, lateral lobes striped brown, midlobe spotted mahogany, overlaid yellow near margin, central mahogany stripe,
	callus white, spotted mahogany, heavily ciliate;
	column white overlaid gold distally, stripped mahogany inferior surface, mahogany on anther cap and anterior margin;


	substance firm; texture matte.
